import React, { useState } from "react";
import axios from "axios";

const Hotels = () => {
    const [location, setLocation] = useState("");
    const [checkInDate, setCheckInDate] = useState("");
    const [checkOutDate, setCheckOutDate] = useState("");
    const [numOfPeople, setNumOfPeople] = useState("");
    const [numOfRooms, setNumOfRooms] = useState("");
    const [hotels, setHotels] = useState([]);

    const cityCodes = {
        "New York": "NYC",
        "London": "LON",
        "Paris": "PAR",
        "Tokyo": "TYO"
    };

    const fetchData = async () => {
        try {
            const apiAccessToken = await GenerateNewToken(); // Matches your existing flow
            const cityCode = cityCodes[location]; // Map location to city code
            if (!cityCode) {
                alert("Location not supported.");
                return;
            }

            const response = await axios.get('https://test.api.amadeus.com/v3/shopping/hotel-offers', {
                headers: {
                    'Authorization': `Bearer ${apiAccessToken}`
                },
                params: {
                    cityCode: cityCode,
                    checkInDate: checkInDate,
                    checkOutDate: checkOutDate,
                    roomQuantity: numOfRooms,
                    adults: numOfPeople,
                    radius: 20,
                    currency: 'GBP'
                }
            });

            setHotels(response.data.data);
        } catch (error) {
            console.error("Error fetching hotels:", error);
        }
    };


    const submitForm = async (e) => {
        e.preventDefault();
        await fetchHotelsData();
    };

    return (
        <div className="container">
            <h1>Search for Hotels</h1>
            <form onSubmit={submitForm}>
                <div className="hotel-location">
                    <label>Location:</label>
                    <input type="text" placeholder="Enter your destination" value={location} onChange={(e) => setLocation(e.target.value)} required />
                </div>
                <div className="check-in-date">
                    <label>Check In Date:</label>
                    <input type="date" value={checkInDate} onChange={(e) => setCheckInDate(e.target.value)} required />
                </div>
                <div className="check-out-date">
                    <label>Check Out Date:</label>
                    <input type="date" value={checkOutDate} onChange={(e) => setCheckOutDate(e.target.value)} required />
                </div>
                <div className="number-people">
                    <label>Number of People:</label>
                    <input type="number" min={1} max={20} value={numOfPeople} onChange={(e) => setNumOfPeople(e.target.value)} required />
                </div>
                <div className="number-rooms">
                    <label>Number of Rooms:</label>
                    <input type="number" min={1} max={20} value={numOfRooms} onChange={(e) => setNumOfRooms(e.target.value)} required />
                </div>
                <div className="button">
                    <button className="submit-button" type="submit">Find Hotels</button>
                </div>
            </form>
            {hotels.length > 0 && (
                <div className="hotel-results">
                    <h2>Available Hotels:</h2>
                    {hotels.map((hotel, index) => (
                        <div key={index} className="hotel-card">
                            <h3>{hotel.hotel.name}</h3>
                            <p>{hotel.hotel.address.lines.join(", ")}, {hotel.hotel.address.cityName}</p>
                            <p><strong>Price:</strong> {hotel.offers[0]?.price?.total} {hotel.offers[0]?.price?.currency}</p>
                            <p><strong>Room Type:</strong> {hotel.offers[0]?.room?.typeEstimated?.category}</p>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
};

export default Hotels;
